import { createSlice } from "@reduxjs/toolkit";

export const apexChartSlice = createSlice({
  name: "apexChart",
  initialState: {},
  reducers: {
    setApexChart: (state, action) => {
      state = action.payload;
    },
  },
});

export default apexChartSlice.reducer;
